import React, { useEffect } from 'react';
import { useGoogleLogin, GoogleOAuthProvider } from '@react-oauth/google';
import { useNavigate } from 'react-router-dom';

function LoginPage() {
  const navigate = useNavigate();

  const login = useGoogleLogin({
    onSuccess: (tokenResponse) => {
      console.log(tokenResponse);
      navigate('/main'); // 메인 화면으로 이동
    },
    onError: () => {
      console.log('로그인 실패');
    },
    flow: 'implicit', // 직접 로그인 창을 띄우는 방식
  });

  // 페이지 진입 시 자동으로 구글 로그인 창 열기
  useEffect(() => {
    login();
  }, []);

  return (
    <div>
      <h3>로그인 중입니다...</h3>
    </div>
  );
}

function WrappedLoginPage() {
  return (
    <GoogleOAuthProvider clientId="111472891391-00f7gch3d72blm7gujt008ecuvgds5qr.apps.googleusercontent.com">
      <LoginPage />
    </GoogleOAuthProvider>
  );
}

export default WrappedLoginPage;
